import React from 'react';
import style from '../../articles.module.css';

const Header = (props) => {
    console.log(props)
    return(
        <div>
            <div className={style.articlePostData}>
                Title : {props.title}
            </div>
            <div className={style.articlePostData}>
                Date : {props.date}
            </div>
        </div>
    )
}

export default Header;
